   "keywords":"تقسَّم المخلوقات الحية وفق أحد أنظمة التصنيف المعاصرة إلى ست مجموعات رئيسة تسمَّى ممالك . وتضمُّ كلُّ مملكة مجموعة واسعة من المخلوقات الحية التي تشتر ك في مجموعة من الصفات العامة . والممالك مجموعات واسعة جدا . فالأحصنة والعناكب مثلا لا تشتركان في الكثير من الأشياء ، ومع ذلك فكلاهما ينتمي إلى المملكة الحيوانية يصنِّف العلماء المخلوقات الحية في المملكة الواحدة إلى مستويات ؛ وذلك بالمقارنة بين خلاياها وأنسجتِها وأعضائِها وأجهزتِها ، وهذا يسمح لهم بتقسيم المخلوقات الحية إلى مجموعات أصغر ، يشترك أفرادها معا في عدد أكبر من الصفات . ومستويات التصنيف هي : الشعبة والطائفة والرتبة والفصيلة والجنس والنوع . أصغر مستوى هو النوع . وهو يشمل المخلوقات المتقاربة جدا . فالحصان والحمار الوحشيُّ يشتركان في صفات عديدة ولكنَّهما ليسا من النوع نفسه ، بينما الحصان والمهر متشابهان لدرجة أنهما ينتميان إلى النوع نفسه .  ",
