   "keywords":"وتحتوي الطلائعيات على نواة وعضيَّات تسبح في السَّيتوبلازم ، لكنَّ تركيب جسِمها يتميَّز بالبساطة ، وليس لها أنسجة متخصصة ، كما في الحيوانات والنباتات والفطريات . ومن الطلائعيات ما يشبه الحيوانات ، ومنها ما يشبه النباتات ، ومنها ما يشبه الفطريات . مملكة الطلائعيات تمهيد تتكون مملكة الطلائعيات من مخلوقات وحيدة الخلية ، ومخلوقات متعددة الخلايا . بعض أفراد مملكة الطلائعيات تصنع غذاءها بنفسها ، وبعضها الآخر يتغذَّى على مخلوقات أخرى . كيف يمكن إذا أن نميِّز الطلائعيات ؟ حجم الطلائعيات أكبر كثيرا من حجم البكتيريا ، وهي مخلوقات مجهرية ، أي لا يستطيع الإنسان رؤيتها إلا بالمجهر ، ومنها الأميبا والدياتومات .  ",
