   "keywords":"تمهيد في الطبيعة مخلوقات - منها الفيروسات - تسلك سلوك المخلوقات الحية أحيانا ، وسلوك الأشياء غير الحية أحيانا أخرى . ورغم أنها قد تبدو حية إلا أن العديد من العلماء يعتقدون أنها ليست مخلوقات حية . تصنيف الفيروسات لا يمكن تصنيف الفيروسات ضمن أيٍّ من الممالك الستِّ ؛ لأنها -  في غير عملية التكاثر - لا تقوم بأيٍّ من وظائف الحياة الأساسية خلال حياتِها . أضرار الفيروسات تدخل الفيروسات جسم المخلوق الحي وتسبب مرضه . ومن الأمراض التي تسببها الفيروسات أمراض الرَّشح ( الزكام ) والحصبة ، وأمراض أخرى خطيرة ، منها أنفلونزا الطيور والخنازير والإيدز وشلل الأطفال . وقد تنتقل الفيروسات من شخص إلى آخر بعدَّة طرائق منها العطس والسعال . عندما يصبح الفيروس داخل الجسم يلتصق بخلية ثم يدخلها ، فيسيطر على نشاطاتِها ، ويستخدمها في إنتاج فيروسات أكثر . وعندما تمتلئ الخلية بالفيروسات تنفجر ، فتخرج الفيروسات منها لتهاجم خلايا أخرى مسببة العدوى والأمراض  . ",
